import styled from "styled-components";

export const CollectionBox = styled.div`
padding-top: 120px;
`


export const HeaderCollection = styled.h2`
text-align: center;

font-family: Fraunces;
text-align: center;
font-size: 40px;
line-height: 1.8;

background-image: linear-gradient(to top right, #83888F00, #262729);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
`
